function CartIcon(props) {
    const cart = getCart('cart')
    console.log("ButtonCart", cart)
    return (
        <div>
        {cart ? 
        <Link to="/shoppingcart"><button className="button"><FaLuggageCart /></button></Link> :
        "" }
        </div>
    )
}


export default CartIcon
